import React, { useState } from 'react';
import {
  Box, Typography, TextField, Grid, Paper, Button, Divider,TableCell,TableContainer,TableHead,Table,TableRow,TableBody
} from '@mui/material';
import { useNavigate } from 'react-router-dom';

const ApplicationFormBPT = () => {
  const navigate = useNavigate();

  const [formData, setFormData] = useState({
    // Personal Details
     adNo: '', adDate: '', applicationNo: '', courseName: '', courseCode: '', dateOfEntry: '', lastDate: '', 
     department: '', name: '', fatherName: '', dob: '', age: '', birthPlace: '', status: '', nationality: '', 
     maritalStatus: '', gender: '', differentlyAbled: '', idMark1: '', idMark2: '', universityArea: '',
      inService: '', aadhar: '', fatherEmail: '', fatherAge: '', fatherOccupation: '', motherName: '', 
      motherAge: '', motherOccupation: '', monthlyIncome: '', address: '', country: '', district: '', state: '',
       pincode: '', mobileno: '', email: '' ,
    // Intermediate Subjects
    botany: {
      theory1stYear: '', theory1stMax: '',
      theory2ndYear: '', theory2ndMax: '',
      practical: '', practicalMax: '',
      total: '', totalMax: '',
      maxmarks:''
    },
    zoology: {
      theory1stYear: '', theory1stMax: '',
      theory2ndYear: '', theory2ndMax: '',
      practical: '', practicalMax: '',
      total: '', totalMax: '',
         maxmarks:''
    },
    physics: {
      theory1stYear: '', theory1stMax: '',
      theory2ndYear: '', theory2ndMax: '',
      practical: '', practicalMax: '',
      total: '', totalMax: '',
         maxmarks:''
    },
    chemistry: {
      theory1stYear: '', theory1stMax: '',
      theory2ndYear: '', theory2ndMax: '',
      practical: '', practicalMax: '',
      total: '', totalMax: ''
    },
    english: {
      theory1stYear: '', theory1stMax: '',
      theory2ndYear: '', theory2ndMax: '',
      practical: '', practicalMax: '',
      total: '', totalMax: ''
    },
    secondLanguage: {
      theory1stYear: '', theory1stMax: '',
      theory2ndYear: '', theory2ndMax: '',
      practical: '', practicalMax: '',
      total: '', totalMax: ''
    },

    // Totals
    overallMarks: '', overallMax: '', overallPercentage: '',
    groupMarks: '', groupMax: '', groupPercentage: '',

    // Academic History
    inter2ndYear: '', inter2ndCollege: '', inter2ndPlace: '',
    inter2ndState: '', inter2ndDistrict: '',
    inter1stYear: '', inter1stCollege: '', inter1stPlace: '',
    inter1stState: '', inter1stDistrict: '',
    tenthYear: '', tenthSchool: '', tenthPlace: '',
    tenthState: '', tenthDistrict: '',
    ninthYear: '', ninthSchool: '', ninthPlace: '',
    ninthState: '', ninthDistrict: '',
    eighthYear: '', eighthSchool: '', eighthPlace: '',
    eighthState: '', eighthDistrict: '',
    seventhYear: '', seventhSchool: '', seventhPlace: '',
    seventhState: '', seventhDistrict: '',
    sixthYear: '', sixthSchool: '', sixthPlace: '',
    sixthState: '', sixthDistrict: '',
    // EAPCET Details
    eapcetRegNo: '', eapcetHallTicket: '', eapcetRank: ''
  });
  const handleSubjectChange = (subject, field) => (e) => {
    setFormData(prev => ({
      ...prev,
      [subject]: {
        ...prev[subject],
        [field]: e.target.value
      }
    }));
  };

  const handleSimpleChange = (field) => (e) => {
    setFormData(prev => ({
      ...prev,
      [field]: e.target.value
    }));
  };

  const handleSubmit = () => {
    navigate('/report', { state: formData });
  };
  const renderSubjectFields = (subject, subjectName) => {
    const fields = [
      { label: '1st Year Theory', key: 'theory1stYear', maxKey: 'theory1stMax' },
      { label: '1st Year Max', key: 'theory1stMax' },
      { label: '2nd Year Theory', key: 'theory2ndYear', maxKey: 'theory2ndMax' },
      { label: '2nd Year Max', key: 'theory2ndMax' },
      { label: 'Practicals', key: 'practical', maxKey: 'practicalMax' },
      { label: 'Practical Max', key: 'practicalMax' },
      { label: 'Total', key: 'total', maxKey: 'totalMax' },
      { label: 'Total Max', key: 'totalMax' },
    ];

    return (
      <Box sx={{ mb: 3 }}>
        <Typography variant="body1" sx={{ fontWeight: 'bold' }}>{subjectName}</Typography>
        <Grid container spacing={2}>
          {fields.map(({ label, key, maxKey }) => (
            <Grid item xs={6} md={3} key={key}>
              <TextField
                label={label}
                fullWidth
                value={formData[subject][key]}
                onChange={handleSubjectChange(subject, key)}
                InputProps={{
                  endAdornment: maxKey && formData[subject][maxKey] ? `/ ${formData[subject][maxKey]}` : undefined,
                }}
              />
            </Grid>
          ))}
        </Grid>
      </Box>
    );
  };


  return (
    <Box sx={{ pt: 4, px: 6, pb: 7 }}>
      <Typography variant="h5" gutterBottom align="center">
        APPLICATION FORM - Bachelor of Physiotherapy - 2025
      </Typography>

      <Grid container spacing={3}>
        <Grid item xs={12}>
          <Paper elevation={2} sx={{ p: 2 }}>
            <Typography variant="subtitle1" fontWeight="bold">Advertisement Details</Typography>
            <Grid container spacing={2}>
              <Grid item xs={6}><TextField label="Ad. No." fullWidth value={formData.adNo} onChange={handleSimpleChange('adNo')} /></Grid>
              <Grid item xs={6}><TextField label="Ad. Date" fullWidth value={formData.adDate} onChange={handleSimpleChange('adDate')} /></Grid>
              <Grid item xs={6}><TextField label="Application No." fullWidth value={formData.applicationNo} onChange={handleSimpleChange('applicationNo')} /></Grid>
              <Grid item xs={6}><TextField label="Course Name" fullWidth value={formData.courseName} onChange={handleSimpleChange('courseName')} /></Grid>
              <Grid item xs={6}><TextField label="Course Code" fullWidth value={formData.courseCode} onChange={handleSimpleChange('courseCode')} /></Grid>
              <Grid item xs={6}><TextField label="Date of Entry" fullWidth value={formData.dateOfEntry} onChange={handleSimpleChange('dateOfEntry')} /></Grid>
              <Grid item xs={6}><TextField label="Last Date of Application" fullWidth value={formData.lastDate} onChange={handleSimpleChange('lastDate')} /></Grid>
              <Grid item xs={6}><TextField label="Department" fullWidth value={formData.department} onChange={handleSimpleChange('department')} /></Grid>
            </Grid>
          </Paper>
        </Grid>

        <Grid item xs={12}>
          <Paper elevation={2} sx={{ p: 2 }}>
            <Typography variant="subtitle1" fontWeight="bold">Applicant's Details</Typography>
            <Grid container spacing={2}>
              <Grid item xs={6}><TextField label="Name" fullWidth value={formData.name} onChange={handleSimpleChange('name')} /></Grid>
              <Grid item xs={6}><TextField label="Father's Name" fullWidth value={formData.fatherName} onChange={handleSimpleChange('fatherName')} /></Grid>
              <Grid item xs={6}><TextField label="Date of Birth" fullWidth value={formData.dob} onChange={handleSimpleChange('dob')} /></Grid>
              <Grid item xs={6}><TextField label="Age (on last date)" fullWidth value={formData.age} onChange={handleSimpleChange('age')} /></Grid>
              <Grid item xs={6}><TextField label="Place of Birth" fullWidth value={formData.birthPlace} onChange={handleSimpleChange('birthPlace')} /></Grid>
              <Grid item xs={6}><TextField label="Social Status" fullWidth value={formData.status} onChange={handleSimpleChange('status')} /></Grid>
              <Grid item xs={6}><TextField label="Nationality" fullWidth value={formData.nationality} onChange={handleSimpleChange('nationality')} /></Grid>
              <Grid item xs={6}><TextField label="Marital Status" fullWidth value={formData.maritalStatus} onChange={handleSimpleChange('maritalStatus')} /></Grid>
              <Grid item xs={6}><TextField label="Gender" fullWidth value={formData.gender} onChange={handleSimpleChange('gender')} /></Grid>
              <Grid item xs={6}><TextField label="Differently Abled" fullWidth value={formData.differentlyAbled} onChange={handleSimpleChange('differentlyAbled')} /></Grid>
              <Grid item xs={6}><TextField label="Identification Mark 1" fullWidth value={formData.idMark1} onChange={handleSimpleChange('idMark1')} /></Grid>
              <Grid item xs={6}><TextField label="Identification Mark 2" fullWidth value={formData.idMark2} onChange={handleSimpleChange('idMark2')} /></Grid>
              <Grid item xs={6}><TextField label="University Area" fullWidth value={formData.universityArea} onChange={handleSimpleChange('universityArea')} /></Grid>
              <Grid item xs={6}><TextField label="In-service (Govt.)" fullWidth value={formData.inService} onChange={handleSimpleChange('inService')} /></Grid>
              <Grid item xs={6}><TextField label="Aadhar" fullWidth value={formData.aadhar} onChange={handleSimpleChange('aadhar')} /></Grid>
              <Grid item xs={6}><TextField label="Father's Email" fullWidth value={formData.fatherEmail} onChange={handleSimpleChange('fatherEmail')} /></Grid>
            </Grid>
          </Paper>
        </Grid>

        {/* Parent/Spouse Details */}
        <Grid item xs={12}>
          <Paper elevation={2} sx={{ p: 2 }}>
            <Typography variant="subtitle1" fontWeight="bold">Parents' Details</Typography>
            <Grid container spacing={2}>
              <Grid item xs={4}><TextField label="Father's Name" fullWidth value={formData.fatherName} onChange={handleSimpleChange('fatherName')} /></Grid>
              <Grid item xs={4}><TextField label="Age" fullWidth value={formData.fatherAge} onChange={handleSimpleChange('fatherAge')} /></Grid>
              <Grid item xs={4}><TextField label="Occupation" fullWidth value={formData.fatherOccupation} onChange={handleSimpleChange('fatherOccupation')} /></Grid>
              <Grid item xs={4}><TextField label="Mother's Name" fullWidth value={formData.motherName} onChange={handleSimpleChange('motherName')} /></Grid>
              <Grid item xs={4}><TextField label="Age" fullWidth value={formData.motherAge} onChange={handleSimpleChange('motherAge')} /></Grid>
              <Grid item xs={4}><TextField label="Occupation" fullWidth value={formData.motherOccupation} onChange={handleSimpleChange('motherOccupation')} /></Grid>
              <Grid item xs={4}><TextField label="Monthly Income" fullWidth value={formData.monthlyIncome} onChange={handleSimpleChange('monthlyIncome')} /></Grid>
            </Grid>
          </Paper>
        </Grid>

        {/* Intermediate Marks Section */}
        <Grid item xs={12}>
          <Paper elevation={2} sx={{ p: 2 }}>
            <Typography variant="subtitle1" fontWeight="bold">
              Intermediate Details (Telangana State)
            </Typography>
            <Typography variant="body2" color="text.secondary" gutterBottom>
              Intermediate Marks along with Practicals Details
            </Typography>

            <TableContainer>
    <Table size="small" sx={{ minWidth: 650 }}>
      <TableHead>
        <TableRow sx={{ backgroundColor: '#f5f5f5' }}>
          <TableCell sx={{ fontWeight: 'bold' }}>Subject</TableCell>
          <TableCell sx={{ fontWeight: 'bold' }} align="center">1st Year Theory</TableCell>          
          <TableCell sx={{ fontWeight: 'bold' }} align="center">2nd Year Theory</TableCell>
